import React from "react";
import logo from "../../images/austria.png";
import styles from "./Nav.css";

function Nav() {
  return (
    <div className="Nav">
      <nav>
        <img src={logo} className="logo" alt="logo" />
        <ul className="App-title">
          <li>About Us</li>
          <li>Our Program</li>
          <li>Bootcamp</li>
          <li>Events</li>
          <li>Sign Up</li>
          <li>Login</li>
        </ul>
      </nav>
    </div>
  );
}

export default Nav;
